description:
The 'Barbarians' are often blamed for the collapse of the Roman Empire, but in 
reality they were fascinating civilisations that produced magnificent art. 
Focusing on the Huns, Vandals and Goths, Waldemar follows each tribe's journey 
across Europe and discovers the incredible art they produced along the way.
